import { useState, useEffect } from "react";
import {
  login,
  getMenu,
  addOrder,
  cancelOrder,
  checkout,
  adminOrders,
  myOrders
} from "./api";

import Login from "./components/login";
import Navbar from "./components/Navbar";
import RestaurantList from "./components/RestaurantList";
import Cart from "./components/Cart";
import AdminDashboard from "./components/AdminDashboard";
import OrderHistory from "./components/OrderHistory";

export default function App() {
  const [token, setToken] = useState("");
  const [role, setRole] = useState("");
  const [menu, setMenu] = useState({});
  const [orders, setOrders] = useState([]);
  const [payment, setPayment] = useState("CREDIT_CARD");
  const [showHistoryPrompt, setShowHistoryPrompt] = useState(false);

  const handleLogin = async (u) => {
    const r = await login(u);
    setToken(r.token);
    setRole(r.role);
    setMenu(await getMenu(r.token));

    if (r.role !== "ADMIN") {
      setOrders(await myOrders(r.token));
    }
  };

  const handleAddOrder = async (item, price) => {
    await addOrder(token, item, price);
    setOrders(await myOrders(token));
  };

  const handleCancelOrder = async (id) => {
    await cancelOrder(id, token);
    setOrders(await myOrders(token));
  };

  const handleCheckout = async () => {
    await checkout(token, payment);
    setOrders(await myOrders(token));
    setShowHistoryPrompt(true);
  };

  // ADMIN auto-refresh
  useEffect(() => {
    if (role === "ADMIN") {
      const i = setInterval(() => {
        adminOrders(token).then(setOrders);
      }, 1000);
      return () => clearInterval(i);
    }
  }, [role, token]);

  if (!token) return <Login onLogin={handleLogin} />;

  return (
    <>
      <Navbar role={role} logout={() => window.location.reload()} />

      <div className="p-6">
        {/* ADMIN VIEW */}
        {role === "ADMIN" && <AdminDashboard orders={orders} />}

        {/* USER VIEW */}
        {role !== "ADMIN" && (
          <div className="grid grid-cols-3 gap-6">
            <div className="col-span-2">
              <RestaurantList menu={menu} onAdd={handleAddOrder} />
            </div>

            <div>
              {/* CART */}
              <Cart
                orders={orders.filter(o => o.status === "CREATED")}
                onCancel={handleCancelOrder}
              />

              {/* CHECKOUT */}
              {role !== "MEMBER" && (
                <div className="bg-white p-4 rounded-xl shadow mt-4">
                  <select
                    className="border p-2 w-full rounded mb-2"
                    onChange={(e) => setPayment(e.target.value)}
                  >
                    <option>CREDIT_CARD</option>
                    <option>UPI</option>
                    <option>CASH</option>
                  </select>

                  <button
                    onClick={handleCheckout}
                    className="w-full bg-green-500 text-white py-2 rounded"
                  >
                    Checkout
                  </button>
                </div>
              )}

              {/* ORDER HISTORY PROMPT */}
              {showHistoryPrompt && (
                <div className="bg-blue-100 p-4 rounded-xl shadow mt-4 text-center">
                  <p className="mb-2 font-semibold text-blue-800">
                    Order completed! Check your order history.
                  </p>
                  <button
                    onClick={() => {
                      document
                        .getElementById("order-history")
                        ?.scrollIntoView({ behavior: "smooth" });
                      setShowHistoryPrompt(false);
                    }}
                    className="bg-blue-600 text-white px-4 py-2 rounded"
                  >
                    Go to Orders
                  </button>
                </div>
              )}

              {/* ORDER HISTORY */}
              <OrderHistory
                orders={orders.filter(o => o.status === "PAID")}
              />
            </div>
          </div>
        )}
      </div>
    </>
  );
}
